using System.Collections.Generic;
using DrawingRecognition.Models;
using UnityEngine;

namespace DrawingRecognition.Controllers
{
    /*

    DrawingRecognition - Wrapper class that supports character and drawing recognition
        - Designed to be the only interface you need to interact with to enable standard functionality.
        - Requires an assigned MouseTracker instance, which stores drawn points during runtime and passes them here

    Documentation found here: https://github.com/gilbertdyer2/UnityDrawingRecognition/tree/main?tab=readme-ov-file#setup

    */
    [RequireComponent(typeof(MouseTracker))]
    public class DrawingRecognitionController : MonoBehaviour
    {
    private int precision; // Precision/Unit widths of stored bitmaps. Precision & Width are interchangeable in context of bitmap 

    public List<CharacterLibrary> libraryList;
    private CharacterLibrary currentLib;

    public MouseTracker mouseTracker; // Tracks points (Vector3) of drawing & handles mouse input + lineRenderer instance 

    public Collider2D drawSurface;
    public int DuckPointZValue; // Z value behind the backdrop to mask jumps between drawn strokes

    [SerializeField] private bool useDefaultInitialization;
    [SerializeField] private CustomSymbolsLibrary customLibrary;
    [SerializeField]  private int setPrecisionOnInitialize = 3;

    void Awake() { 
        
        if (useDefaultInitialization) {
            SetupDefaultLibraries();
        }
        // DrawSurface setup
        mouseTracker.DuckPointZValue = DuckPointZValue; 
        if (drawSurface != null) {
            SetDrawSurface(drawSurface);
        }
    }

    // Sets the current library to make changes to
    public void SetLibrary(int libraryNum) {
        if (libraryNum >= libraryList.Count || libraryNum < 0) {
            Debug.Log("LibraryManager.SetLibrary Failed - Input index out of range");
        }
            
        currentLib = libraryList[libraryNum];
    }

    // Updates the precision/width of stored bitmaps in current library to the input value
    //      !!Higher values do not necessarily translate to better results!! 
    //      - 3 is recommended for most cases, and odd values are generally better because they tend to capture centers more accurately
    //      - Drawings that need to be more precise (i.e. larger size with finer details) may benefit from higher precision
    //      - Less precise or quickly drawn characters/gestures may benefit from the lowest precision value of 2
    //
    // Higher precision may also throw off weight values by artificially increasing the weights of horizontalMap and verticalMap
    public void SetPrecision(int input) {
        // Debug.Log("Setting width of library to: " + input);
        if (input <= 1 || input == precision) {
            return;
        }

        precision = input;
        mouseTracker.precision = input; // Update mouseTracker, for Bitmap initialization of drawing
        // Directly access bitmaps of every character library & set width
        foreach (CharacterLibrary charLib in libraryList) {
            foreach (Character character in charLib.characterList) {
                character.bitmap.SetPrecision(input);
            }
        }
    }

    public int GetPrecision() {
        return precision;
    }
    
    // Sets the weights of all stored libraries to specified values
    //      - To set the weight of individual libraries, use characterLibrary.SetWeights()
    //      - Weights (1.0, 1.0, 1.0, 1.0) are recommended, and formed from testing the included libraries & other common use cases
    public void SetWeights(double circleMapWeight, double gridMapWeight, double horizontalMapWeight, double verticalMapWeight) {
        foreach (CharacterLibrary charLib in libraryList) {
            charLib.SetWeights(circleMapWeight, gridMapWeight, horizontalMapWeight, verticalMapWeight);
        }
    }
    

    // Returns the stored list of libraries
    public List<CharacterLibrary> GetLibraryList() {
        return libraryList;
    }
    // Returns current character library
    public CharacterLibrary GetCurrentLibrary() {
        return currentLib;
    }

    // Returns the list of characters stored in the current library
    public List<Character> GetCharList() {
        return currentLib.characterList;
    }
    // Overload for obtaining character list from a specified library
    //      - A bit redundant outside of standardizing the interface; directly calling 'characterLibrary.characterList' works fine
    public List<Character> GetCharList(CharacterLibrary charLib) {
        return charLib.characterList;
    }
    
    
    
    #region Add/Rem. Chars
    // Adds the current drawing as a character to the current library
    public void AddDrawingToLib(string charName) {
        Character c = new Character(mouseTracker.GetBitmap(), charName);
        currentLib.AddCharacter(c);
    }
    // Overload for adding to a specified library
    public void AddDrawingToLib(string charName, CharacterLibrary charLib) {
        Character c = new Character(mouseTracker.GetBitmap(), name);
        currentLib.AddCharacter(c);
    }

    // Adds the specified character to the current library.
    public void AddCharToLib(Character character) { 
        // Null & invalid input cases for add & remove are handled in CharacterLibrary
        currentLib.AddCharacter(character); // Simplifies interface, possible unnecessary layering
    }
    // Overload for adding to a specified library
    public void AddCharToLib(Character character, CharacterLibrary charLib) { 
        charLib.AddCharacter(character); 
    }

    // Removes a character from the current library
    public void RemoveCharFromLib(Character character) {
        currentLib.RemoveCharacter(character);
    }
    // Overload for removing character from a specified library
    public void RemoveCharFromLib(Character character, CharacterLibrary charLib) {
        charLib.RemoveCharacter(character);
    }
    // Overloads for string lookup:
    public void RemoveCharFromLib(string charName) {
        currentLib.RemoveCharacter(charName);
    }
    public void RemoveCharFromLib(string charName, CharacterLibrary charLib) {
        charLib.RemoveCharacter(charName);
    }

    // Clears the list of stored libraries
    public void ClearLibraryList() {
        libraryList.Clear();
    }

    #endregion Add/Rem. Chars

    
    
    #region Comparison Functions

    // Returns the closest Character match to the current drawing in the current library
    public Character GetMatch() {
        Bitmap drawingBitmap = mouseTracker.GetBitmap();
        Debug.Log($"DrawingRecognition - Found match: '{currentLib.GetMatch(drawingBitmap).Key.name}'");
        return currentLib.GetMatch(drawingBitmap).Key;
    }
    // Overload for getting a match from a specified library
    public Character GetMatch(CharacterLibrary charLib) {
        Bitmap drawingBitmap = mouseTracker.GetBitmap();
        Debug.Log($"DrawingRecognition - Found match: '{currentLib.GetMatch(drawingBitmap).Key.name}'");
        return charLib.GetMatch(drawingBitmap).Key; // Returns the Key of the match kvp (Character, value)
    }

    // Returns a sorted list of (Character -> Score) KVPs, representing the drawing's similarity to each character in the current library
    //      - List is sorted from Closest Matches (highest % score) -> Least likely matches (lowest % score)
    public List<KeyValuePair<Character, double>> GetMatchList() {
        Bitmap drawingBitmap = mouseTracker.GetBitmap();
        return currentLib.GetMatchList(drawingBitmap);
    }
    // Returns a sorted list of KVP scores based on a specified library's characters
    public List<KeyValuePair<Character, double>> GetMatchList(CharacterLibrary charLib) {
        Bitmap drawingBitmap = mouseTracker.GetBitmap();
        return charLib.GetMatchList(drawingBitmap);
    }

    #endregion Comparison Functions

    
    
    #region Drawing (MouseTracker)
    // Layered methods from mouseTracker

    public void SetDrawSurface(Collider2D collision2D) {
        mouseTracker.SetDrawSurface(collision2D);
    }

    public void ClearDrawing() {
        mouseTracker.ClearDrawing();
    }

    // Enables (true) or Disables (false) checks for drawing controls within MouseTracker.
    public void EnableDrawing(bool inp) {
        mouseTracker.shouldCheckControls = inp;
    }

    // Shows (true) or Hides (false) the drawn line (visual change only).
    public void ShowDrawing(bool inp) {
        if (inp) {
            mouseTracker.ShowDrawing();
        }
        else {
            mouseTracker.HideDrawing();
        }
    }

    // Sets the drawing to the specified character
    public void DisplayCharacter(Character character) {
        if (character == null) {
            return;
        }
        mouseTracker.DisplayCharacter(character);
    }

    #endregion Drawing (MouseTracker)
    
    

    #region Default Initializer

    // Sets libraryList to the specified default state defined within this method
    //      - Current Defaults: Lowercase Alphabet, Symbol Library, 3 empty custom libraries
    public void SetupDefaultLibraries() {
        libraryList = new List<CharacterLibrary>();

        CharacterLibrary alphabetLib = new CharacterLibrary("Lowercase Alphabet");
        InitializeLowercaseAlphas(alphabetLib);
        CharacterLibrary symbolLib = new CharacterLibrary("Symbols");
        InitializeSymbols(symbolLib);
        
        libraryList.Add(alphabetLib);
        libraryList.Add(symbolLib);
        libraryList.Add(customLibrary.Library);

        currentLib = libraryList[2];

        SetWeights(1.0, 1.0, 1.0, 1.0);
        SetPrecision(setPrecisionOnInitialize);
    }

    #endregion Default Initializer
    
