    /*

    Debug & Prefab tools to: 
        - copy Characters drawn during runtime to the clipboard as code snippets to be pasted into PreFab CharacterLibrary Init.
        - visualize bitmap representations of character drawings,
        
    */
    #region Debug Print Tools

    // Returns a prefabbed character initializer, to be pasted into PreFab CharacterLibrary Initialization
    //      - Bitmap constructor (for reference):
    //      - public Bitmap(Vector3[] points, Vector3[] worldPoints, float left, float right, float top, float bottom, int curIndex, int curDrawIndex, int width)
    public string PrintCurCharacter() {
        List<Vector2> points = mouseTracker.points;
        List<Vector3> worldPoints = mouseTracker.worldPoints;

        // Print Syntax: List<Vector2> example = new List<Vector2>{new Vector2(0, 0), new Vector2(0, 0)};
        string vectorPrint = "List<Vector2> name = new List<Vector2>{ ";
        for (int i = 0; i < points.Count; i++) {
            vectorPrint += "new Vector2(" + points[i].x + "f, " +  points[i].y + "f ), ";
        }
        vectorPrint += "};\n \t \t"; 

        string worldVectorPrint = "List<Vector3> nameW = new List<Vector3>{ ";
        for (int i = 0; i < worldPoints.Count; i++) {
            worldVectorPrint += "new Vector3(" + worldPoints[i].x + "f, " +  worldPoints[i].y + "f, " +  worldPoints[i].z + "f " + "), ";
        }
        worldVectorPrint += "};\n \t \t"; 
        Debug.Log(worldVectorPrint);
        string combined = vectorPrint + worldVectorPrint + "charLib.AddCharacter(new Character(new Bitmap( name, nameW, "
                         + precision + " ), \"name\"));";

        CopyToClipboard(combined);
        return combined;
    }
    // Copies the current selected library to clipboard as a prefab paste, and prints to debug log
    public string PrintCharacterLibrary() {
        string allCharsPaste = ""; 
        List<Character> charList = currentLib.characterList;
        for (int k = 0; k < charList.Count; k++) {
            string charName = charList[k].name;
            List<Vector2> points = charList[k].bitmap.points;
            List<Vector3> worldPoints = charList[k].bitmap.worldPoints;

            string vectorPrint = $"List<Vector2> {charName} = new List<Vector2>{{ ";
            for (int i = 0; i < points.Count; i++) {
                vectorPrint += "new Vector2(" + points[i].x + "f, " +  points[i].y + "f ), ";
            }
            vectorPrint += "};\n \t \t"; 

            string worldVectorPrint = $"List<Vector3> {charName}W = new List<Vector3>{{ ";
            for (int i = 0; i < worldPoints.Count; i++) {
                worldVectorPrint += "new Vector3(" + worldPoints[i].x + "f, " +  worldPoints[i].y + "f, " +  worldPoints[i].z + "f " + "), ";
            }
            worldVectorPrint += "};\n \t \t"; 
            
            string combined = vectorPrint + worldVectorPrint + $"charLib.AddCharacter(new Character(new Bitmap( {charName}, {charName}W, "
                            + precision + $" ), \"{charName}\"));\n\n";
            
            allCharsPaste += combined;
        }
        
        CopyToClipboard(allCharsPaste);
        return allCharsPaste;
    }

    // Copies a string of text to clipboard in editor, used for creating prefabbed characters
    private void CopyToClipboard(string s) {
        TextEditor te = new TextEditor();
        te.text = s;
        te.SelectAll();
        te.Copy();
    }

    // Prints the 2D GridMap representation of the current drawing
    //      - Recommended use during debug is to bind this to a hotkey that calls 'drawingRecognition.PrintGridMap(mouseTracker.GetBitmap())'
    //      - Value of each cell = (# of points in cell) / (total # of points in drawing)
    //      - All cells should sum (very close) to 1.0  (if not, something is probably broken)
    public void PrintGridMap(Bitmap bitmap) {
        Debug.Log("Printing drawing's GridMap:           (timestamp:"+  Time.time + ")");

        string[] rows = new string[bitmap.width];
        
        // Add each row to 'rows'
        for (int i = bitmap.width - 1; i >= 0; i--) {
            string rowPrint = "Row " + i + ": {";

            for (int k = 0; k < bitmap.width; k++) {
                rowPrint += bitmap.gridMap[i,k].ToString("F3") + ", "; 
            }
            rowPrint += "}\t\t\t(timestamp" + Time.time  + ")\n"; // Timestamp prevents Unity Debug message pooling for duplicates

            rows[bitmap.width - i - 1] = rowPrint;
        }

        
        foreach (string s in rows) {
            Debug.Log(s);
        }
    }

    // Prints the 2D circle map representation stored by a bitmap
    //      - Each 2x2 group of vals printed represents a ring, starting from inner ring, ending at outer ring
    public void PrintCircleMap(Bitmap bitmap) {
        Debug.Log("Printing drawing's CircleMap:           (timestamp:"+  Time.time + ")");
        string[] ringSegments = new string[bitmap.width]; // array of all radial rings, each separated into 4 quadrants
        
        // Add each radial segment, [{Quadrant 1, Quadrant 2, Q3, Q4}, ]
        for (int i = 0; i < bitmap.width; i++) {
            string ringPrint = "Ring " + (i + 1) + ": {";

            ringPrint += bitmap.medCircMap[i][3].ToString("F3") + ", "; // Quadrant 4
            ringPrint += bitmap.medCircMap[i][0].ToString("F3") + "} \n"; // Quadrant 1
            ringPrint += "\t\t          {" + bitmap.medCircMap[i][2].ToString("F3") + ", "; // Quadrant 3
            ringPrint += bitmap.medCircMap[i][1].ToString("F3"); // Quadrant 2
            
            ringPrint += "}\t\t\t(timestamp" + Time.time  + ")\n"; // Timestamp prevents Unity Debug message pooling for duplicates

            ringSegments[i] = ringPrint;
        }

        foreach (string s in ringSegments) {
            Debug.Log(s);
        }
    }
    
    // Same as above, but circle is centered around the Center of Mass instead of geometric median
    //      - Used during testing for comparing effectiveness of center of mass vs. geo median
    public void PrintCoMCircleMap(Bitmap bitmap) {
        Debug.Log("Printing drawing's CircleMap:           (timestamp:"+  Time.time + ")");
        string[] ringSegments = new string[bitmap.width]; // array of all radial rings, each separated into 4 quadrants
        
        // Add each radial segment, [{Quadrant 1, Quadrant 2, Q3, Q4}, ]
        for (int i = 0; i < bitmap.width; i++) {
            string ringPrint = "Ring " + (i + 1) + ": {";

            ringPrint += bitmap.circMap[i][3].ToString("F3") + ", "; // Quadrant 4
            ringPrint += bitmap.circMap[i][0].ToString("F3") + "} \n"; // Quadrant 1
            ringPrint += "\t\t          {" + bitmap.circMap[i][2].ToString("F3") + ", "; // Quadrant 3
            ringPrint += bitmap.circMap[i][1].ToString("F3"); // Quadrant 2
            // for (int k = 0; k < 4; k++) {
            //     ringPrint += bitmap.circMap[i][k] + ", "; 
            // }
            ringPrint += "}\t\t\t(timestamp" + Time.time  + ")\n"; // Timestamp prevents Unity Debug message pooling for duplicates

            ringSegments[i] = ringPrint;
        }

        foreach (string s in ringSegments) {
            Debug.Log(s);
        }
    }

    // Prints the horizontal FlatMap representation stored by a bitmap.
    public void PrintFlatMapHorizontal(Bitmap bitmap) {
        int[] flatMap = bitmap.flatMapHorizontal;
        string str = "Horizontal FlatMap: ";
        for (int i = 0; i < flatMap.Length; i++) {
            str += $"{flatMap[i]}, ";
        }

        Debug.Log(str);
    }
    // Prints the vertical FlatMap representation stored by a bitmap.
    public void PrintFlatMapVertical(Bitmap bitmap) {
        int[] flatMap = bitmap.flatMapVertical;
        string str = "Vertical FlatMap: \n";
        for (int i = 0; i < flatMap.Length; i++) {
            str += $"{flatMap[i]}\n";
        }

        Debug.Log(str);
    }



